""" Testing zombie game """
import unittest
from collections import Counter
from string_processor import count, word


class TestGetScrambledStringsMap(unittest.TestCase):
    """ Testing function get_scrambled_strings_map """

    def test_get_scrambled_strings_map_scrambled_strings(self):
        """ Testing get_scrambled_strings_map with two scrambled strings and another string """
        output = count.get_scrambled_strings_map(['abcde', 'acdbe', 'pxrs'])
        self.assertEqual(output, {5: {word.Word('abcde'): 2}, 4: {word.Word('pxrs'): 1}})

    def test_get_scrambled_strings_map_same_letters(self):
        """ Testing get_scrambled_strings_map with scrambled words of different lengths """
        output = count.get_scrambled_strings_map(['abcde', 'acdbe', 'abbde'])
        self.assertEqual(output, {5: {word.Word('abcde'): 2, word.Word('abbde'): 1}})
    
    def test_get_scrambled_strings_map_diff_lengths(self):
        """ Testing get_scrambled_strings_map with all strings of different lengths """
        output = count.get_scrambled_strings_map(['ab', 'acdbe', 'abb', 'abde'])
        self.assertEqual(output, {2: {word.Word('ab'): 1}, 3: {word.Word('abb'): 1}, 4: {word.Word('abde'): 1}, 5: {word.Word('abcde'): 1}})

